{"text":"Gluroo is a supportive app designed for helping people manage diabetes more effectively. It enables real-time sharing and monitoring of blood glucose levels, carbohydrate intake, insulin doses, and other essential data with family, friends, and caregivers. It integrates with popular glucose monitoring systems like Libre CGM, Dexcom, and other diabetes management systems.

You can find extensive help and guides on various topics by visiting their support page at [Gluroo Support](https://gluroo.com/support/). Some example topics include troubleshooting CGM integration, using the app with artificial pancreas systems, displaying glucose levels on smartwatches, and more.

For more details and blog posts about user experiences, app functionalities, and updates, visit [Gluroo Blog](https://gluroo.com/blog/glucrew/)."}
